import React from 'react';
import { Card, CardContent, CardMedia, Typography, Grid,Button } from '@mui/material';
import image3 from './image4.webp'
import PrescriptionPage from './prescription';



const PatientCard = ({ name, dob, disease, value,age, image }) => {
  return (
    
    <Card sx={{ maxWidth: 545}}  className=""  style={{height:"500px",width:"700px",marginLeft:"480px",background:"#E6E6FA",paddingTop:"20px",marginTop:"100px",paddingLeft:"20px",border:"2px solid"}}>
      <Grid container>
        <Grid item xs={4}>
          <CardMedia
            component="img"
            height="200"
            image={image3}
            alt={name}
            // border="2px black solid"
            
          />
        </Grid>
        <Grid item xs={8}>
            
          <CardContent style={{marginLeft:"70px"}}>
            <Typography gutterBottom variant="h4" component="div">
              {name}
            </Typography>
            <Typography color="text.secondary" variant="h" component="div">
              Age:{age}
            </Typography>
            <Typography variant="h5" style={{marginTop:"20px"}} color="text.secondary">
              Date of Birth: {dob}
            </Typography>
            <Typography variant="h5" style={{marginTop:"20px"}} color="text.secondary">
              Disease: {disease}
            </Typography>
            <Typography variant="h5" style={{marginTop:"20px"}} color="text.secondary">
              Gender: {value}
            </Typography>
           <a href='/prescription'> <Button style={{color:"white",background:"#B22222",marginTop:"200px",marginLeft:"100px",marginTop:"100px"}} onClick={PrescriptionPage} variant='contained'>Prescripition</Button>
            </a>
          </CardContent>
        </Grid>
        
      </Grid>
    </Card>
    
  );
};

const LandingPage = () => {
  return (
    <div style={{ backgroundColor: "#DCDCDC", minHeight: "100vh" }}>
    <h1  className="card shadow-lg  "style={{marginLeft:"650px",paddingTop:"50px",fontFamily:"'Roboto', sans-serif"}}>Patient Details</h1>
        <hr></hr>
      <Grid container spacing={2}>
        <Grid item xs={12} sm={6} md={4}>
          <PatientCard
            name="Jhonny"
            age="24"
            dob="01/01/1990"
            disease="Flu"
            value="Male"
            image="https://via.placeholder.com/150"
          />
          
        </Grid>
       
        {/* Add more PatientCard components as needed */}
      </Grid>
     
      
    </div>
  );
};

export default LandingPage;
